import React from 'react';
import logo from './logo.svg';
import './App.css';
import Form from "./components/form";
import { Container, Row, Col } from 'reactstrap';

function App() {
  return (
    <div className="App">
      <Form />
      <footer>
        <Container>
          <Row>
            <Col sm={12} className="text-center">Copyright Â© Your Website 2020.</Col>
          </Row>
        </Container>
      </footer>
    </div>
  );
}

export default App;
